description:
Dinosaure gonflable Bestway ;
Dimensions : 135 x 198 cm (53” x 78”) ;
Couleur : multicolore ;
Déconseillé aux : Enfants de moins de 3 ans ;
Poids maximum : 45 kg (99 lb) ;
Possède : deux poignées robustes pour plus de sécurité et de mobilité ;
Fabriqué avec : vinyle durable ;
Convient pour : Utilisation en piscine ou en mer ;
Comprend : Kit de réparation.

La pompe de filtre à sable pour piscine Bestway est destinée à la purification mécanique de l’eau de la piscine. Du sable de quartz spécialement tamisé (0,45-0,85 mm) est utilisé comme élément filtrant. L’unité de filtrage est complétée par une pompe, une vanne à six positions pour changer de mode de fonctionnement et un manomètre pour indiquer la pression dans le système. La pompe de filtre à sable pour piscine Bestway peut être utilisée avec les piscines rondes Intex et Bestway jusqu’à 366 cm de diamètre.
 Principaux avantages:
Degré plus élevé de purification de l’eau des impuretés mécaniques que les pompes avec éléments filtrants en papier ;
L’élément filtrant (sable de quartz) nécessite un remplacement rare – une fois tous les 2-3 mois ;
Pompe (capacité 3028 l/h) ;
Réservoir résistant à la corrosion pour l’élément filtrant ;
Vanne 6 positions ;
Filtre intégré qui collecte la saleté ;
Distributeur ChemConnect ;
Adaptateur B, adaptateur de crépine, buse d’entrée, grille filtrante incluse.
Caractéristiques:
Performance de la pompe : 3028 l/h ;
Performances du système : 2006 l/h ;
Recommandé pour les piscines avec un volume d’eau : de 1000 à 16000 litres ;
Capacité du réservoir : environ 8,5 kg de sable ou 240 g de billes filtrantes Polysphere Flowclear ; (acheter séparément);
Taille des particules de sable : 0,45-0,85 mm ;
Alimentation : 220 V ;
Consommation électrique : 85 W ;
Poids (sans sable) : 8 kg.
